import { useState } from "react";

const PRODUCTS = [
  {category: "Fruits", price: "$1", stocked: true, name: "Apple"},
  {category: "Fruits", price: "$1", stocked: true, name: "Dragonfruit"},
  {category: "Fruits", price: "$2", stocked: false, name: "Passionfruit"},
  {category: "Vegetables", price: "$2", stocked: true, name: "Spinach"},
  {category: "Vegetables", price: "$4", stocked: false, name: "Pumpkin"},
  {category: "Vegetables", price: "$1", stocked: true, name: "Peas"}
];

function ProductCategoryRow({product}) {
  return (
    <tr key={product.name}>
      <td colSpan="2" style={{textAlign:"center", backgroundColor:"black", color:"white"}}>
        {product.category}
      </td>
    </tr>
  );
}

function ProductRow({product}) {
  const name = product.stocked ? product.name : 
    <span style={{color:"red"}}>
      {product.name}
    </span>;

  return (
    <tr key={product.name}>
      <td>{name}</td>
      <td>{product.price}</td>
    </tr>
  );
}

function ProductTable({products}) {
  const rows = [];
  let lastCategory = null;

  products.forEach((product) => {
    if (product.category !== lastCategory) {
      lastCategory = product.category;
      rows.push(
        <ProductCategoryRow product={product} />
      );
    } else {
      rows.push(
        <ProductRow product={product} />
      );
    }
  });
  return (
    <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Price</th>
        </tr>
      </thead>
      <tbody>
        {rows}
      </tbody>
    </table>
  );
}

function SearchBar({searchText, inStockOnly}) {
  return (
    <form>
        <input 
          type="text" 
          value={searchText}
          placeholder="search..." />
        <br />
        <label>
          <input 
            type="checkbox" 
            checked={inStockOnly}
          />
          {' '}
          Only show products in stock!
        </label>
      </form>
  );
}

export default function FilterableProductsTable() {
  const [searchText, setSearchText] = useState(null);
  const [inStockOnly, setInStockOnly] = useState(false);

  return (
    <>
      <SearchBar 
        searchText={searchText} 
        inStockOnly={inStockOnly} 
      />
      <ProductTable 
        products={PRODUCTS} 
      />
    </>
  );
}
